import Web3 from 'web3';
import logo from './리뷰.png';
import React, { useState, useEffect } from 'react';
import { Navbar, Nav, NavDropdown, Button, Container, Offcanvas, Form, FormControl } from 'react-bootstrap';


const Bar = () => {

    return (
        <Navbar bg="" expand="lg">
        <Container fluid>
            <Navbar.Brand href="#">
                    <img
                        src={logo}
                        width="100"
                        height="50"
                    />
                   RIVIEW ZONE
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="navbarScroll" />
            <Navbar.Collapse id="navbarScroll">
                <Form className="d-flex">
                    <FormControl
                        type="search"
                        placeholder="Search"
                        className="me-4"
                        aria-label="Search"
                    />
                    <Button variant="outline-success">Search</Button>
                </Form>
            </Navbar.Collapse>
        </Container>

    </Navbar>
    );
};

export default Bar;
<Card style={{ width: '18rem' }}>  
<Card.Img variant="top" src="holder.js/100px180" />  
<Card.Body>    
    <Card.Title>Card Title</Card.Title>    
    <Card.Text>      Some quick example text to build on the card title and make up the bulk of      the card's content.    
    </Card.Text>    
    <Button variant="primary">Go somewhere</Button>  </Card.Body></Card>
